import { useState } from "react";

const CaughtPokemon = () => {
  const pokemonNames = [
    "Abra",
    "Altaria",
    "Bergmite",
    "Bayleef",
    "Beautifly",
    "Bonsly",
  ];
  const [caught, setCaught] = useState([]);

  const catchPokemon = () => {
    let randomCaughtPokemon = Math.floor(Math.random() * pokemonNames.length);
    setCaught((previousCaught) =>
      previousCaught.concat(pokemonNames[randomCaughtPokemon])
    );
  };

  const date = new Date().toLocaleDateString();
  console.log(caught);
  return (
    <div>
      <p>
        Caught {caught.length} Pokemon on {date}
      </p>
      <button onClick={() => catchPokemon()}> Catch Pokemon</button>
      <ul>
        {/* {caught.map((element, i) => {
          return <li key={i}>{element}</li>;
        })} */}
        {/* <li> {caught}</li> */}
      </ul>
    </div>
  );
};
export default CaughtPokemon;
